CREATE TABLE roster (
	location varchar(10) NOT NULL,
	start datetime NOT NULL,
	strand int NOT NULL,
	shift varchar(20) NOT NULL,
	[on] datetime,
	[off] datetime,
	split bit,
	on2 datetime,
	off2 datetime,
	cycle varchar(20),
	seq int NOT NULL,
	cycle_start datetime NOT NULL,
	day int,
	[key] int NOT NULL,
	notes text
);
